import React from "react";
import "./Ticket.css"
import { NavLink } from "react-router-dom";


const Ticket = (props) =>{
    return (
        <div className="ticket-container">
        <NavLink to={`/support/${props.ticketid}`}>{props.ticketheme}</NavLink>
        </div>
    );
}

export default Ticket;
